\documentclass{article}
\usepackage[utf8]{inputenc}
\title{Optimization Model}
\author{Name}
\date{\today}
\begin{document}

\maketitle

\tableofcontents

\section{1. Sets (Entities)}
\begin{enumerate}
    \item Customers
    \item Products
    \item Suppliers
    \item Orders
\end{enumerate}

\section{2. Indices}
\begin{enumerate}
    \item $i$: index of customers (i = 1, 2, ..., I)
    \item $j$: index of products (j = 1, 2, ..., J)
    \item $k$: index of suppliers (k = 1, 2, ..., K)
    \item $l$: index of orders (l = 1, 2, ..., L)
\end{enumerate}

\section{3. Goals}
\begin{enumerate}
    \item Maximize profit
    \[
    \text{Maximize } P = \sum_{i=1}^{I}\sum_{j=1}^{J} p_{ij} x_{ij}
    \]
    \item Minimize cost
    \[
    \text{Minimize } C = \sum_{k=1}^{K} c_k s_k + \sum_{l=1}^{L} f_l o_l
    \]
\end{enumerate}

\section{4. Conditions}
\begin{enumerate}
    \item Customer constraints:
    \[
    0 \leq x_{ij} \leq a_i, \quad i = 1, 2, ..., I; \quad j = 1, 2, ..., J
    \]
    \item Product constraints:
    \[
    b_j \leq \sum_{i=1}^{I} x_{ij} \leq d_j, \quad j = 1, 2, ..., J
    \]
    \item Supplier constraints:
    \[
    e_k c_k - f_k \leq s_k \leq g_k h_k + f_k, \quad k = 1, 2, ..., K
    \]
\end{enumerate}

\section{5. Decision Variables}
\begin{enumerate}
    \item $x_{ij}$: quantity of product j ordered by customer i (j = 1, 2, ..., J; i = 1, 2, ..., I)
    \item $s_k$: amount of money allocated to supplier k (k = 1, 2, ..., K)
    \item $o_l$: quantity of products in order l (l = 1, 2, ..., L)

\end{document}
